import React from 'react';

import { View, Image, Text, TextInput, StyleSheet, TouchableOpacity } from 'react-native'

import logo from '../../assets/logo-faccar.png';

export default function Login() {
    return (
        <View style={style.container}>
            <Image source={logo} style={style.logo} />
            <View style={style.form}>
                <Text style={style.label}>Informe seu E-mail</Text>
                <TextInput
                    style={style.input}
                    placeholder="Seu e-mail"
                    autoCompleteType="email"
                    placeholderTextColor="#999"
                    autoCapitalize="none"
                    keyboardType="email-address"
                    autoCorrect={false}
                ></TextInput>
                <Text style={style.label}>Informe sua Senha</Text>
                <TextInput
                    style={style.input}
                    placeholder="Sua Senha"
                    autoCompleteType="password"
                    secureTextEntry={true}
                    placeholderTextColor="#999"
                    autoCapitalize="none"
                    autoCorrect={false}
                ></TextInput>

                <TouchableOpacity style={style.button}>
                    <Text style={style.textButton}>Logar</Text>
                </TouchableOpacity>
                <Text style={style.recoverPass}>Recuperar Senha</Text>
            </View>
        </View>
    );
}

const style = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    logo: {
        resizeMode: 'cover',
    },
    form: {
        alignSelf: 'stretch',
        paddingHorizontal: 30,
        marginTop: 30,
    },
    label: {
        fontWeight: 'bold',
        color: '#444',
        marginBottom: 5,
        marginTop: 10,
    },
    input: {
        borderWidth: 1,
        borderColor: '#ddd',
        paddingHorizontal: 20,
        paddingVertical: 10,
        fontSize: 16,
        color: '#444',
        borderRadius: 5,
    },
    button: {
        height: 40,
        backgroundColor: '#028134',
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 5,
        marginTop: 10,
    },
    textButton: {
        color: '#fff',
    },
    recoverPass: {
        color: '#aaa',
        paddingTop: 20,
        textAlign: 'center',        
    }
})
